@gwenwakanda E terceiro, a forma como ela culpa o Clark pela morte do Jimmy, quando a culpa na verdade foi dela e do Davis.

Ela jogou a culpa em todo mundo, menos em si mesma, pois foi o amante dela, um ser humano, não o Doomsday que matou o Jimmy.

Ela queria que o Clark matasse?
